      this.dm.setField ( this.dm.get ( "DIRECCIONES_LOC_DSD" ), "COD_TIPO_DIRECCION", "SERV" );
      
      DIRECCIONES_LOC_STAT  = this.dm.limitQueryFromBuffer ( DIRECCIONES_LOC );
