      this.dm.setField ( this.dm.get ( "DIRECCIONES_LOC_DSD" ), "COD_TIPO_DIRECCION", "SERV" );
      this.dm.setField ( this.dm.get ( "DIRECCIONES_LOC_DSD" ), "DSC_DIRECCION_1", this.app.form ( "TRANSFER_FR" ).getStringItem ( "DIRECCION_POS_1" ));
